import React from "react";
import houseLogo from "../../assets";
import {
  BuyButton,
  BuyContainer,
  HeaderContainer,
  Logo,
  RentButton,
  RentContainer,
} from "./styles";

export default function Home() {
  return (
    <>
      <HeaderContainer>
        <Logo src={houseLogo}></Logo>
        Navbar placeholder
      </HeaderContainer>
      <RentContainer>
        Rent homes here
        <RentButton>Click to rent</RentButton>
      </RentContainer>
      <BuyContainer>
        Buy a home here
        <BuyButton>CLick to buy</BuyButton>
      </BuyContainer>
      footer
    </>
  );
}
